(52,1,"2019-09-06 20:39:31","2019-09-06 20:39:31","<!-- wp:heading {\"level\":3} -->\n<h3>Bar Keepers Friend products are made by:</h3>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns has-2-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p><strong>Servaas Laboratories Inc.<br>5240 Walt Place <br>Indianapolis, Indiana 46254 <br>United States <br>+1 (317) 636-7760</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p><strong> Toll free for USA and Canada<br> 1-800-433-5818</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p>We are here to answer any questions you may have about our Premium Cleaning Products.  Please provide a Subject so that we can find the best person to provide you assistance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are interested in more information about our bulk sizes or NSF products, please use our <a href=\"#\">Institutional Contact Form</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you would like to distribute BKF products in your country, please use our <a href=\"#\">International Distributor Inquiry Form</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you would like to share a Before &amp; After story and images, please visit our <a href=\"#\">Before &amp; After page</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->","Contact","","inherit","closed","closed","","17-revision-v1","","","2019-09-06 20:39:31","2019-09-06 20:39:31","",17,"http://bkf.local/17-revision-v1/",0,"revision","",0),
