(355,1,"2019-09-17 15:18:35","2019-09-17 15:18:35","Stainless steel appliances have a thin coating that prevents corrosion. Cleaners containing bleach, acid, or abrasives can damage that coating and leave appliances looking dull and blotchy. BKF Stainless Steel Cleaner &amp; Polish cuts through grease and grime without damaging the protective coating on appliances.\r\n\r\nThis product is also effective on uncoated stainless steel, so it has multiple uses throughout the home.","What\'s the best way to clean stainless steel?","","publish","closed","closed","","whats-the-best-way-to-clean-stainless-steel","","","2019-09-17 15:18:35","2019-09-17 15:18:35","",0,"http://bkf.local/?post_type=product_faq&#038;p=355",0,"product_faq","",0),
(356,1,"2019-09-17 15:19:02","2019-09-17 15:19:02","<ul>\r\n 	<li>Shake product well.</li>\r\n 	<li><strong>Routine cleaning</strong>: Spray directly onto surface. Wipe along the grain/brush lines, using a soft, clean dry cloth (microfiber works especially well) or paper towel. Flip cloth to dry side and buff to an even shine.</li>\r\n 	<li><strong>Heavier soiled surface</strong>: Spray cleaner onto surface. Let stand about 1 minute. Rub surface lightly with a non-abrasive, nylon-mesh sponge or microfiber towel. Wipe the surface dry with a clean soft cloth, paper towel, or microfiber cloth.</li>\r\n</ul>\r\nUse Bar Keepers Friend Stainless Steel Cleaner &amp; Polish on stainless steel appliances, fixtures, sporting equipment, outdoor grills, and more.","How do I use Bar Keepers Friend Stainless Steel Cleaner & Polish?","","publish","closed","closed","","how-do-i-use-bar-keepers-friend-stainless-steel-cleaner-polish","","","2019-09-17 15:19:02","2019-09-17 15:19:02","",0,"http://bkf.local/?post_type=product_faq&#038;p=356",0,"product_faq","",0),
(357,1,"2019-09-17 15:19:21","2019-09-17 15:19:21","BKF Stainless Steel Cleaner &amp; Polish is safe for use on coated and uncoated stainless steel, but it is not recommended for other types of metal. To clean bronze, copper, and brass, use <a href=\"https://www.barkeepersfriend.com/cleaning-products/soft-cleanser/\">Bar Keepers Friend Soft Cleanser</a>.","Is BKF Stainless Steel Cleaner & Polish safe to use on all types of metal?","","publish","closed","closed","","is-bkf-stainless-steel-cleaner-polish-safe-to-use-on-all-types-of-metal","","","2019-09-17 15:19:21","2019-09-17 15:19:21","",0,"http://bkf.local/?post_type=product_faq&#038;p=357",0,"product_faq","",0),
