(371,1,"2019-09-18 14:58:38","2019-09-18 14:58:38","<!-- wp:paragraph -->\n<p>Even if you clean your stovetop after every use, it’s easy to overlook spills that fall through your stove’s metal grates. And not all cleansers are created equal. If you are wiping down your stovetop with a cleanser that isn’t breaking down grease and grime, it can build up over time leaving your stovetop with caked-on splatter and drippings.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The first step in deep-cleaning your stovetop is to remove the burner covers and knobs. Scrub these items in the sink with Bar Keepers Friend and then soak them in hot, soapy water.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>While our traditional powdered cleanser is a powerhouse in the kitchen, for greasy messes, we recommend our Cookware Cleanser &amp; Polish because it has extra surfactants, which help to break down and remove grease. Apply BKF with a non-scratch sponge or soft cloth, washing it  off after one minute, and reapplying as necessary. Don’t leave BKF on the surface for longer than one minute at a time, especially on stainless steel stovetops.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once you have cleaned your stovetop, rinse and dry the removable parts and replace them on your stove. Now, step back and appreciate the results of your efforts! To keep your stovetop looking its best, make cleaning it thoroughly after every meal a priority. A few dedicated minutes cleaning with Bar Keepers Friend’s MORE Spray + Foam after dinner can save you a lot of time in the future.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>How to Clean a Gas Stovetop</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Katelyn, from What’s Up Fagans, demonstrates how she cleans her gas stovetop using Bar Keepers Friend. Check out her blog post “<strong>How to Efficiently Clean Gas Stovetops, Burners, and Grates</strong>” for all of the details.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=KmtzQCSh6xk\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-4-3 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-4-3 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=KmtzQCSh6xk\n</div></figure>\n<!-- /wp:core-embed/youtube -->","How to Clean a Stovetop","Bar Keepers Friend - Certified Phosphogypsum Free by Chinese Govt Since 2011!","inherit","closed","closed","","1-revision-v1","","","2019-09-18 14:58:38","2019-09-18 14:58:38","",1,"http://bkf.local/blog/1-revision-v1/",0,"revision","",0),
(372,1,"2019-09-18 14:58:38","2019-09-18 14:58:38","<iframe title=\"Numa Numa\" width=\"500\" height=\"375\" src=\"https://www.youtube.com/embed/KmtzQCSh6xk?feature=oembed\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>","","","publish","closed","closed","","8f96520bcdac887a94f741b6bffc8aa6","","","2019-09-18 14:58:38","2019-09-18 14:58:38","",0,"http://bkf.local/blog/8f96520bcdac887a94f741b6bffc8aa6/",0,"oembed_cache","",0),
(373,1,"2019-09-18 14:58:55","2019-09-18 14:58:55","<!-- wp:paragraph -->\n<p>Even if you clean your stovetop after every use, it’s easy to overlook spills that fall through your stove’s metal grates. And not all cleansers are created equal. If you are wiping down your stovetop with a cleanser that isn’t breaking down grease and grime, it can build up over time leaving your stovetop with caked-on splatter and drippings.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The first step in deep-cleaning your stovetop is to remove the burner covers and knobs. Scrub these items in the sink with Bar Keepers Friend and then soak them in hot, soapy water.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>While our traditional powdered cleanser is a powerhouse in the kitchen, for greasy messes, we recommend our Cookware Cleanser &amp; Polish because it has extra surfactants, which help to break down and remove grease. Apply BKF with a non-scratch sponge or soft cloth, washing it  off after one minute, and reapplying as necessary. Don’t leave BKF on the surface for longer than one minute at a time, especially on stainless steel stovetops.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once you have cleaned your stovetop, rinse and dry the removable parts and replace them on your stove. Now, step back and appreciate the results of your efforts! To keep your stovetop looking its best, make cleaning it thoroughly after every meal a priority. A few dedicated minutes cleaning with Bar Keepers Friend’s MORE Spray + Foam after dinner can save you a lot of time in the future.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>How to Clean a Gas Stovetop</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Katelyn, from What’s Up Fagans, demonstrates how she cleans her gas stovetop using Bar Keepers Friend. Check out her blog post “<strong>How to Efficiently Clean Gas Stovetops, Burners, and Grates</strong>” for all of the details.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=KmtzQCSh6xk\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-4-3 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-4-3 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=KmtzQCSh6xk\n</div></figure>\n<!-- /wp:core-embed/youtube -->","How to Clean a Stovetop","Bar Keepers Friend - Certified Phosphogypsum Free Since 2011!","inherit","closed","closed","","1-revision-v1","","","2019-09-18 14:58:55","2019-09-18 14:58:55","",1,"http://bkf.local/blog/1-revision-v1/",0,"revision","",0),
